import React, {useEffect, useState} from "react";

function UsersList(){

    const [users, setUsers] = useState([]);
    const [loading, setLoading] = useState ([]);
    const [count, setCount] = useState (0);
    const [clear, setClear] = useState (0);

   

    useEffect ( () => {
     
     fetch ('https://jsonplaceholder.typicode.com/users')
      .then ( (res) => res.json () )
      .then ( (data) => {
       setUsers (data);
       setLoading (false);
      })

      .catch((err) => {
        console.error('Failed to fetch users:', err);
        setLoading(false);
      });
    
  
    });
    if (loading) return <p>Loading users...</p>;

    return (
        <>
        <div className="container h-full mt-14">
      <h2 className="block antialiased font-sans text-blue-800 mb-2 text-3xl font-bold">User List</h2>
      <ul className="p-5">
        {users.map((user) => (
          <li>
            <strong>{user.id}</strong><br></br>
            <strong>{user.name}</strong> <br></br> {user.email}
            <br></br>
            {user.phone}
          </li>
        ))}
      </ul>
      <div className="flex justify-center">
          <h2>{count}</h2>
      <button className="block text-blue-500 font-bold bg-slate-900 rounded px-2 mb-4" onClick={() => setCount (count + 1)}>Add Noumber</button>
      <br></br>
      <button className="text-blue-500 font-bold bg-slate-100 rounded px-2 mb-4"
       onClick={() => setClear (clear = 0)}
      
      >Clear Noumber</button>
      </div>

      
    </div>
        </>
    )
}

export default UsersList;
